import React from 'react'
import { Link } from 'react-router-dom'

const MAinNav = () => {
  return (
      <nav>
        <ul>
            <li><Link to="/allfoods">AllFoods</Link></li>
            <li><Link to="/mycart">MyCart</Link></li>
        </ul>
      </nav>

  )
}

export default MAinNav
